package net.wanho.vo.customer;

public class PrincipalVo {
	private Integer employeeId;
	private String employeeName;
	private String departmentName;
	private String positionName;
	private String phoneNum; 
	
	
	public PrincipalVo() {
		super();
		// TODO Auto-generated constructor stub
	}
	public PrincipalVo(Integer employeeId, String employeeName, String departmentName, String positionName,
			String phoneNum) {
		super();
		this.employeeId = employeeId;
		this.employeeName = employeeName;
		this.departmentName = departmentName;
		this.positionName = positionName;
		this.phoneNum = phoneNum;
	}
	public Integer getEmployeeId() {
		return employeeId;
	}
	public void setEmployeeId(Integer employeeId) {
		this.employeeId = employeeId;
	}
	public String getEmployeeName() {
		return employeeName;
	}
	public void setEmployeeName(String employeeName) {
		this.employeeName = employeeName;
	}
	public String getDepartmentName() {
		return departmentName;
	}
	public void setDepartmentName(String departmentName) {
		this.departmentName = departmentName;
	}
	public String getPositionName() {
		return positionName;
	}
	public void setPositionName(String positionName) {
		this.positionName = positionName;
	}
	
	public String getPhoneNum() {
		return phoneNum;
	}
	public void setPhoneNum(String phoneNum) {
		this.phoneNum = phoneNum;
	}
	@Override
	public String toString() {
		return "PrincipalVo [employeeId=" + employeeId + ", employeeName=" + employeeName + ", departmentName="
				+ departmentName + ", positionName=" + positionName + ", phoneNum=" + phoneNum + "]";
	}
	
	
}
